import styled from 'styled-components';

export const DetailDemo =styled.div`
    margin-top:58px;
    position:relative;

`
export const BackTitle=styled.div`
    position:fixed;
    top:56px;
    width:100%;
    background:#333333;
    height:50px;
    line-height:50px;
    .DetailIcon{
        text-align:right;
    }
    .DetailText{
        text-align:left;
        color:white;
    }
`
